1. Key Psychological Mechanisms: When acting as a proposer, participants may aim to balance fairness norms (based on relative contributions measured by token_self and token_opp) with self‐interest. They may adjust the split in response to the disparity in contributions. In addition, the experimental condition (trial_type) indicates whether the contributions are equal or skewed toward one party and may induce additive biases in the proposals.
2. How These Mechanisms Interact: A normative fairness ratio can be computed as:
  fairness_ratio = token_opp / (token_self + token_opp)
This fairness norm is then modulated by an overall bias (alpha) and by additional additive shifts when the condition is not “equal” (i.e. trial_type 2 or 3). In trial_type=2 (opponent contributed more) or trial_type=3 (participant contributed more), an extra bias (beta2, beta3 respectively) is added. Finally, random noise (with standard deviation sigma) accounts for trial‐to‐trial variability.
3. Mathematical Form: A linear formula is adopted:
  proposed_perc = alpha + lambda × fairness_ratio + beta2 × I(trial_type = 2) + beta3 × I(trial_type = 3) + ϵ
with ϵ ~ N(0, sigma²). This predicts the percentage proposed to the opponent.
